    font-weight: 400;
    line-height: 1.1;
    margin-bottom: 5px;
    display: block;
}

.comment-list .comment-meta .date {
    color: #757575;
    font-size: 13px;
    font-weight: 400;
    line-height: 1.1;
    display: inline-block;
    margin-right: 5px;
}

.comment-list .comment-meta .reply-link {
    font-size: 13px;
    font-weight: 400;
    display: inline-block;
}

.comment-list .comment-content {
    margin-left: 90px;
}

.comment-list .comment {
    margin-bottom: 40px;
}

.comment-list .comment:last-child {
    margin-bottom: 0;
}

.comment-list .comment .comment {
    margin-top: 20px;
    margin-left: 55px;
}

.comment-reply {
    margin-top: 45px;
}

.comment-reply .input-field label {
    text-transform: none;
    color: #9a9a9a;
}

@media (max-width: 767px) {
    .comment .comment {
        margin-left: 35px;
    }

    .comment .comment-avatar {
        width: 40px;
        height: 40px;
    }

    .comment .comment-content {
        margin-left: 60px;
    }
}

@media (max-width: 480px) {
    .comment-list .comment .comment {
        margin-left: 0;
    }
}

/**
 * 13.0 - Error Page
 */
.header-has-img .page-404 {
    margin-top: 170px;
}

.page-404 {
    color: #000000;
    font-size: 30px;
    font-weight: 300;
    text-align: center;
    padding: 50px 0;
}

.page-404 p {
    margin-bottom: 60px;
}

.page-404 h2 {
    color: #d1d1d1;
    font-size: 170px;
    line-height: 1;
    font-weight: 700;
    margin-bottom: 40px;
}

.page-404 h2 span {
    margin: 0 10px;
    position: relative;
    display: inline-block;
}

.page-404 h2 span:before {
    content: '';
    width: 0;
    height: 0;
    left: 50%;
    bottom: 5px;
    display: block;
    margin-left: -10px;
    position: absolute;
    border-style: solid;
    border-width: 0px 0px 15px 17px;
    border-color: transparent;
    -webkit-transform: rotate(15deg);
    -moz-transform: rotate(15deg);
    transform: rotate(15deg);
}

.page-404 .btn {
    color: #a7a7a7 !important;
    width: 100%;
    max-width: 256px;
    display: block;
    margin: 0 auto;
}

@media (max-width: 480px) {
    .page-404 {
        font-size: 25px;
    }

    .page-404 h2 {
        font-size: 120px;
    }
}

/**
 * 14.0 - Footer
 */
.footer-social {
    padding: 30px 0;
}

.footer-social .social li a .rsicon {
    color: #d7d7d7;
    -webkit-transition: -webkit-transition, color 0.25s linear 0s;
    -moz-transition: -moz-transition, color 0.25s linear 0s;
    transition: transition, color 0.25s linear 0s;
}

.footer-social .social li a:hover .rsicon {
    color: #6e6e6e;
}

@media (max-width: 767px) {
    .footer {
        padding-bottom: 30px;
    }
}

